import React from 'react';
import Case from './Case';


class Raw extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
    for (var i = 0; i < 6; i++) {
      return (
        <div className={"raw"+this.props.aorb}>
          <Case aorb={this.props.aorb}></Case>
        </div>
      );
    }
  }
}


export default Raw;
